pragma solidity ^0.5.0;

contract MyContract {
    string public name;
    string public symbol;
    mapping (address => uint256) private balanceOf;
    uint256 public totalsupply;
    uint8 public decimals;

    constructor() public {
        name = "0";
        symbol = "0";
        decimals = 0;
    }

    function mint(uint256 amount) public payable {
        require(balanceOf[msg.sender] + amount >= balanceOf[msg.sender], "Overflow error");
        if (msg.value == 0 && amount == 0) {
            balanceOf[msg.sender] += amount;
            totalsupply += amount;
        } else if (amount != 0 && ((amount * 0x1550f7dca70000) / amount) == 0x1550f7dca70000 && msg.value == amount * 0x1550f7dca70000) {
            balanceOf[msg.sender] += amount;
            totalsupply += amount;
        }
    }

    function burn(uint256 amount) public {
        require(amount <= balanceOf[msg.sender], "Insufficient balance");
        if (balanceOf[msg.sender] == amount) {
            balanceOf[msg.sender] -= amount;
            if (amount == 0) {
                msg.sender.transfer(0);
                totalsupply -= amount;
            } else if (((amount * 0x1550f7dca70000) / amount) == 0x1550f7dca70000) {
                msg.sender.transfer(amount * 0x1550f7dca70000);
                totalsupply -= amount;
            }
        }
    }

    function transfer(address to, uint256 amount) public {
        require(amount <= balanceOf[msg.sender], "Insufficient balance");
        require(balanceOf[to] + amount >= balanceOf[to], "Overflow error");
        balanceOf[msg.sender] -= amount;
        balanceOf[to] += amount;
    }
}
